script: |
  super -f text -I q10275.spq | sort > q10275.out

inputs:
  - name: q10275.spq
    data: |
      SELECT - 58 FROM tab0 (FORMAT parquet) AS cor0 WHERE 62 NOT BETWEEN col1 * + + col2 / + + col2 AND + - 20;
  - name: tab0

outputs:
  - name: q10275.out
    data: |
      -58
      -58
      -58
